import blogImg12 from "./img/blog-12-img.jpg";
import blogImg13 from "./img/blog-13-img.jpg";
import blogImg14 from "./img/blog-14-img.jpg";

const Home = () => {
  return (
    <Container>
      <Row className="pt-5 fresh-blogs">
        <Col xs={12} md={6}>
          <Col sm={12}>
            <div style={{ backgroundImage: `url(${blogImg1})` }}> </div>
          </Col>
        </Col>
        <Col xs={12} md={6}>
          <Row>
            <Col xs={6}>
              {" "}
              <div style={{ backgroundImage: `url(${blogImg2})` }}> </div>{" "}
