              {" "}
              <div style={{ backgroundImage: `url(${blogImg5})` }}> </div>{" "}
            </Col>
          </Row>
        </Col>
      </Row>
      <Row>
        <Col xs={12} md={3}>
          <div style={{ backgroundImage: `url(${blogImg6})` }}> </div>
        </Col>
        <Col xs={12} md={3}>
          <div style={{ backgroundImage: `url(${blogImg7})` }}> </div>
        </Col>
        <Col xs={12} md={3}>
          <div style={{ backgroundImage: `url(${blogImg8})` }}> </div>
        </Col>
      </Row>
      <Row>
        <Col xs={12} md={3}>
          <div style={{ backgroundImage: `url(${blogImg9})` }}> </div>
        </Col>
        <Col xs={12} md={3}>
          <div style={{ backgroundImage: `url(${blogImg10})` }}> </div>
        </Col>
        <Col xs={12} md={3}>
          <div style={{ backgroundImage: `url(${blogImg11})` }}> </div>
        </Col>
      </Row>
      <Row>
        <Col xs={12} md={3}>
          <div style={{ backgroundImage: `url(${blogImg12})` }}> </div>
        </Col>
        <Col xs={12} md={3}>
          <div style={{ backgroundImage: `url(${blogImg13})` }}> </div>
        </Col>
        <Col xs={12} md={3}>
          <div style={{ backgroundImage: `url(${blogImg14})` }}> </div>
        </Col>
      </Row>
    </Container>
  );
};

export default Home;
